import React from "react";
import "./Navbar.css";

function Navbar() {
  return (
    <>
      <div id="mySidenav" class="sidenav">
        <a href="javascript:void(0)" className="closebtn">
          &times;
        </a>
        <a href="#">About</a>
        <a href="#">Services</a>
        <a href="#">Clients</a>
        <a href="#">Contact</a>
      </div>
    </>
  );
}

export default Navbar;
